"use strict";dotclear.ready(()=>{const e=document.querySelector("#dock");if(!e)return;const t=e.getBoundingClientRect(),n=[...document.getElementsByClassName("jstElements")],s=new IntersectionObserver((n,s)=>{for(const s of n){const n=s.boundingClientRect.y+s.boundingClientRect.height>=t.top,o=s.target.classList.contains("hide");n?o||(e.style.zIndex="0"):e.style.zIndex="999"}},{threshold:[1],trackVisibility:!0,delay:100});for(const e of n)s.observe(e)});
